import React, { useState, useEffect, useRef } from "react";
import { Navbar, Nav, Container, Button } from "react-bootstrap";
import { FaBars } from "react-icons/fa"; // For a custom toggle icon

const Header = () => {
  const [showDropdown, setShowDropdown] = useState(false);
  const [isMobile, setIsMobile] = useState(false);
  const dropdownRef = useRef(null);

  useEffect(() => {
    const handleResize = () => setIsMobile(window.innerWidth < 992);
    handleResize();
    window.addEventListener("resize", handleResize);
    return () => window.removeEventListener("resize", handleResize);
  }, []);

  useEffect(() => {
    const handleClickOutside = (event) => {
      if (dropdownRef.current && !dropdownRef.current.contains(event.target)) {
        setShowDropdown(false);
      }
    };
    if (isMobile && showDropdown) {
      document.addEventListener("mousedown", handleClickOutside);
    }
    return () => document.removeEventListener("mousedown", handleClickOutside);
  }, [isMobile, showDropdown]);

  const handleDropdownToggle = () => {
    if (isMobile) setShowDropdown(!showDropdown);
  };

  const handleMouseEnter = () => !isMobile && setShowDropdown(true);
  const handleMouseLeave = () => !isMobile && setShowDropdown(false);

  return (
    <div onMouseLeave={handleMouseLeave}>
      <Navbar expand="lg" sticky="top" className="py-3 bg-transparent border display-8 fw-medium">
        <Container>
          <Navbar.Brand href="/">
            <img src="/logo.png" alt="Company Logo" height="30" />
          </Navbar.Brand>

          {/* Custom Hamburger Toggle */}
          <Navbar.Toggle
            aria-controls="navbar-nav"
            className="border-0"
            style={{
              fontSize: "1.2rem", // smaller icon
              color: "#C8102E",   // custom color
            }}
          >
            <FaBars />
          </Navbar.Toggle>

          <Navbar.Collapse id="navbar-nav">
            <Nav className="mx-auto gap-4" onMouseLeave={handleMouseLeave}>
              <Nav.Link href="#about">About Us</Nav.Link>

              <Nav.Item
                onMouseEnter={handleMouseEnter}
                onClick={handleDropdownToggle}
                className="position-relative"
                ref={dropdownRef}
              >
                <Nav.Link href="#portfolio" role="button" aria-expanded={showDropdown}>
                  Portfolio
                </Nav.Link>

                {showDropdown && (
                  <div
                    className="shadow-sm"
                    style={{
                      position: "absolute",
                      top: "110%",
                      left: "50%",
                      transform: "translateX(-50%)",
                      background: "#fff",
                      padding: "2rem",
                      borderRadius: "4px",
                      zIndex: 999,
                      display: "flex",
                      flexDirection: "column",
                      minWidth: "300px",
                    }}
                  >
                    {[
                      ["#wtc", "World Trade Center, Swiz"],
                      ["#tower1", "Site Tower 1"],
                      ["#tower2", "Site Tower 2"],
                      ["#plaza", "Site Plaza"],
                      ["#warehouses", "Warehouses"],
                      ["#terrace", "The Ocean Terrace"],
                    ].map(([href, label]) => (
                      <a
                        key={href}
                        href={href}
                        className="text-dark fs-6 text-decoration-none py-2"
                      >
                        {label}
                      </a>
                    ))}
                  </div>
                )}
              </Nav.Item>

              <Nav.Link href="#why-choose-us">Why Choose Us</Nav.Link>
              <Nav.Link href="#blog">Blog</Nav.Link>
              <Nav.Link href="#contact">Contact Us</Nav.Link>
            </Nav>

            <div className="d-none d-lg-block">
              <Button
                variant="outline-secondary"
                className="fw-medium fs-6 px-4 py-2"
                style={{
                  borderRadius: "4px",
                  color: "#000",
                  borderColor: "#999",
                }}
              >
                Book An Appointment
              </Button>
            </div>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </div>
  );
};

export default Header;
